Each kernel module usually has an initializing function specified with the module_init() function (macro?). Similarly there is a deinitializing function specified with the module_exit() function. Here is a simple kernel module: #include <linux/init.h>
#include <linux/module.h>
#include <linux/kernel.h> MODULE_LICENSE("GPL"); // Needed. static int __init init_kernel_mod(void) { printk(KERN_ALERT "Initializing kernel mod!\n"); return 0;
} static void __exit exit_kernel_mod(void) { printk(KERN_ALERT "Releasing kernel mod resources!\n");
} module_init(init_kernel_mod);
module_exit(exit_kernel_mod); And the associated Makefile: CONFIG_MODULE_SIG=n
obj-m += my_kernel_mod.o default: make -C /lib/modules/$(shell uname -r)/build M=$(PWD) modules clean: make -C /lib/modules/$(shell uname -r)/build M=$(PWD) clean Review the Linux kernel module development documentation for details.

